import "./Character.css";
import characters from "../db/Character/Character";

function Character(){
    const data = characters;
    const dataItem = data.map((list) => (
        <li>
            {list.char_id}<br/>
            {list.name}<br/>
            {list.name}<br/>
            {list.name}<br/>
            {list.name}<br/>
            {list.name}<br/>
            {list.name}<br/>
            {list.name}<br/>
            {list.name}<br/>
         </li>
    ));
    return (
        <div>
            <p>{dataItem}</p>
        </div>
    );
}

export default Character;
